void loadIcon(IconType icon) {
    if (icon < 0 || icon >= ICON_MAX)
        return;

    iconDefinitions[icon].data = icondata[(int) icon];
}

Icon* getIcon(IconType icon) {
    if (icon < 0 || icon >= ICON_MAX)
        return NULL;
    
    return &iconDefinitions[icon];
}

void drawIcon(Icon *icon, int16_t x, int16_t y) {
    UG_DrawPixelArray(x, y, x+icon->width-1, y+icon->height-1, icon->data);
}
